data Author = Author {
  name :: String,
  email :: String,
  date :: String
} deriving (Data, Typeable, Show)

data CommitInfo = CommitInfo {
  author :: Author
} deriving (Data, Typeable, Show)

data Commit = Commit {
  commit :: CommitInfo
} deriving (Data, Typeable, Show)

userName :: IO String
userName = do
  args <- getArgs
  return (if (length args > 0) then head args else "johnfn")

